import React from 'react';
import './education.css';

// Education/Skills (10 pts): List your academic history, including your degree(s), major(s), 
// minor(s), and any relevant coursework. Be sure to showcase your technical skills, programming 
// languages, software proficiency, or any other relevant abilities. You can organize them by 
// proficiency level, category, or time (latest at top, oldest at bottom)

function Education() {
    return (
        <div>

            <div className='XDUlogo'>
                <img src="/XDUlogo.png" alt="XDUlogo" />
            </div>
            <div className="education">
                <h2>Education</h2>
                <p>XiDian University</p>
                <p>Major: Software Engineer</p>
                <p>2020-2024</p>
            </div>

            <div className='skills'>
                <h2>Skills</h2>
                <p>C++</p>
                <p>Python</p>
                <p>React</p>
                <p>HTML</p>
                <p>CSS</p>
                <p>JavaScript</p>
            </div>
        </div>
    );
}

export default Education;
